import '../Styles/Sort.css';
import React, { useState, useEffect } from 'react';

import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

function initializeArray(arr, num) {
    for (var i = 0; i < num; i++) {
        arr[i] = Math.floor(Math.random() * (Math.round(window.innerHeight / 100) * 75)) + 15; // random between 1 & Math.round(window.innerHeight / 100)
    }
}

function Sort() {

    var array = [];

    return (
        <div className="Sort">

            <Form />

            <div className="Header">
                Sorting Algorithms {/* change after form submitted */}
            </div>
            <div className="Body">
                {initializeArray(array, 100)}
                {array.map((x, i) => (
                    <div className="bar" style={{height: `${x}px`}} key={i}/>
                ))}
            </div>
        </div>
    );
}

function Form() {
    const [open, setOpen] = React.useState(true);

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    return (
        <div>
        <Dialog open={open} onClose={handleClose}>
            <DialogTitle>Sorting Algorithms</DialogTitle>
            <DialogContent>

            <TextField
                autoFocus
                margin="dense"
                id="name"
                label="Email Address"
                type="email"
                fullWidth
                variant="standard"
            />
            </DialogContent>
            <DialogActions>
            <Button onClick={handleClose}>Back</Button> {/* GO back to home*/}
            <Button onClick={handleClose}>Submit</Button>
            </DialogActions>
        </Dialog>
        </div>
    );
}

export default Sort;
